await robot.userRequest('参观接待区');
await robot.goto('接待区');
await robot.speak('欢迎参观接待区。请跟随我，我将为您提供导览。');
await robot.speak('接待区位于大楼一层，您可以从会客厅出发，沿着走廊一直向前走。');
await robot.speak('在走廊尽头，您会看到一个大门，这就是接待区的入口。');
await robot.speak('入口处有一个标识牌，上面写着“接待区”，请您留意。');
await robot.speak('进入接待区后，您会看到一个舒适的休息区，供您休息和等候。');
await robot.speak('接待区还设有专业的接待人员，他们会为您提供热情周到的服务。');
await robot.speak('如果您有任何问题或需要帮助，请随时向接待人员咨询。');
await robot.speak('感谢您参观接待区，希望您在这里度过愉快的时光。');

